e virtual machine (Compute Engine) used as the bastion server for the SSH tunnel.", "type": "string" } } }, "CloudSqlSettings": { "type": "object", "description": "Settings for creating a Cloud SQL database instance.", "id": "CloudSqlSettings", "properties": { "userLabels": { "type": "object", "additionalProperties": { "type": "string" }, "description": "The resource labels for a Cloud SQL instance to use to annotate any related underlying resources such as Compute Engine VMs. An object containing a list of \"key\": \"value\" pairs. Example: `{ \"name\": \"wrench\", \"mass\": \"18kg\", \"count\": \"3\" }`." }, "autoStorageIncrease": { "description": "[default: ON] If you enable this setting, Cloud SQL checks your available storage every 30 seconds. If the available storage falls below a threshold size, Cloud SQL automatically adds additional storage capacity. If the available storage repeatedly falls below the threshold size, Cloud SQL continues to add storage until it reaches the maximum of 30 TB.", "type": "boolean" }, "rootPasswordSet": { "readOnly": true, "description": "Output only. Indicates If this connection profile root password is stored.", "type": "boolean" }, "rootPassword": { "description": "Input only. Initial root password.", "type": "string" }, "databaseFlags": { "additionalProperties": { "type": "string" }, "description": "The database flags passed to the Cloud SQL instance at startup. An object containing a list of \"key\": value pairs. Example: { \"name\": \"wrench\", \"mass\": \"1.3kg\", \"count\": \"3\" }.", "type": "object" }, "dataDiskSizeGb": { "format": "int64", "type": "string", "description": "The storage capacity available to the database, in GB. The minimum (and default) size is 10GB." }, "tier": { "type": "string", "description": "The tier (or machine type) for this instance, for example: `db-n1-standard-1` (MySQL instances) or `db-custom-1-3840` (PostgreSQL instances). For more information, see [Cloud SQL Instance Settings](https://clo